INSERT INTO `items` VALUES (1,'Potion','Restores a small amount of health.',1,8,0,10),(2,'Mega Potion','Restores a moderate amount of health.',2,2,0,10),(3,'Max Potion','Fully restores health and maximizes the size of your Health Gauge.',3,210,0,2),(4,'Ancient Potion','Fully restores health and maximizes the size of your Health and Stamina Gauges.',5,345,0,1),(5,'Antidote','A cure for poison.',1,6,0,10),(6,'Herbal Medicine','Removes all traces of poison and restores a slight amount of health.',2,25,0,5),(7,'Nulberry','A mysterious berry that cures various blights.',2,120,0,10),(8,'Energy Drink','A Guild-approved beverage that boosts your stamina. Helps shake off sleep, too!',2,6,0,10),(9,'Ration','Food that restores a bit of stamina.',1,3,0,10),(10,'Rare Steak','Provides a moderate boost to your stamina. This one\'s still red in the middle.',1,3,0,10),(11,'Well-done Steak','Provides a moderate boost to your stamina and keeps it at max for a longer period. Meat done right!',2,48,0,10),(12,'Burnt Meat','Provides a small boost to your stamina. Can be eaten quickly.',1,1,0,10),(13,'Cool Drink','Provides temporary relief from extreme heat.',1,30,0,5),(14,'Nutrients','Very slightly increases your maximum health level.',2,25,0,5),(15,'Mega Nutrients','Slightly increases your maximum health level.',3,92,0,5),(16,'Immunizer','Boosts your natural ability to heal.',3,92,0,10),(17,'Astera Jerky','Juicy, dried meat made by Astera\'s chef. Boosts natural healing and cures bleeding.',2,10,0,5),(18,'Dash Juice','Dulls one\'s sense of exhaustion. Reduces stamina depletion for a time.',2,29,0,5),(19,'Mega Dash Juice','Lets you dash without tiring for longer than regular dash juice does.',3,205,0,5),(20,'Might Seed','Temporarily strengthens your attacks when ingested by improving energy flow.',2,140,0,10),(21,'Demondrug','',0,0,0,0),(22,'Mega Demondrug','',0,0,0,0),(23,'Might Pill','',0,0,0,0),(24,'Adamant Seed','',0,0,0,0),(25,'Armorskin','',0,0,0,0),(26,'Mega Armorskin','',0,0,0,0),(27,'Adamant Pill','',0,0,0,0),(28,'Lifepowder','',0,0,0,0),(29,'Herbal Powder','',0,0,0,0),(30,'Demon Powder','',0,0,0,0),(31,'Hardshell Powder','A mysterious powder that produces a cloud around the area that temporarily strengthens defense.',4,315,0,3),(32,'Honey','Highly nutritious honey. Combine this with Potions to craft Mega Potions for maximum potency.',2,45,0,10),(33,'Herb','A primary ingredient in potions.',1,2,0,10),(34,'Antidote Herb','A primary ingredient in antidotes.',1,2,0,10),(35,'Fire Herb','A wondrous, flammable plant. Useful for crafting explosives.',2,4,0,20),(36,'Flowfern','This plant\'s leaves store a great amount of water. A component for making Water Ammo.',1,4,0,20),(37,'Snow Herb','A plant that radiates ice-cold air. Use in combinations to create freeze ammo.',2,6,0,20),(38,'Sleep Herb','A plant containing sleeping agents. Used to craft tranquilizers.',1,5,0,10),(39,'Ivy','A lightweight and extremely strong plant. Used to make nets for pitfall traps.',1,8,0,10),(40,'Smokenut','A nut that produces a copious amount of smoke. Combine with other items to create smoke with various properties.',1,4,0,10),(41,'Dragonfell Berry','A mysterious berry, rumored for eons to be loathed by dragons. Required to craft Dragon Ammo.',4,78,0,10),(42,'Blue Mushroom','A mushroom infused with power-enhancing effects. Used in restorative items.',2,2,0,10),(43,'Mandragora','A dangerous fungus said to draw the life out of people. Beware. Required to craft Max Potions.',3,40,0,10),(44,'Nitroshroom','A hard-to-find mushroom with the power to generate blazing heat. Required to craft Gunpowder.',2,6,0,20),(45,'Devil\'s Blight','A very rare fungus that pulses with extreme heat. Add to a barrel bomb for a dramatically stronger blast.',2,60,0,10),(46,'Parashroom','A mushroom that induces paralysis. Required to craft Tranq Bombs.',3,15,0,10),(47,'Toadstool','A poisonous fungus. Can be used as a toxin for knives.',2,8,0,10),(48,'Exciteshroom','This one has a very strange aroma. Is it edible? Only one way to find out! Required to craft Farcasters.',3,18,0,10),(49,'Chillshroom','This mushroom is a primary ingredient in cool drinks.',3,18,0,10),(50,'Bitterbug','A sharp-tasting bug with innate healing abilities. Used as an ingredient in many medicines.',1,2,0,10),(51,'Flashbug','An insect that emits a powerful flash when it dies. Required to craft Flash Pods.',2,48,0,10),(52,'Godbug','An insect said to live a millennium. Combine it with other items to add their properties to the powder.',4,120,0,10),(53,'Thunderbug','An insect that emits electricity when struck. Required to craft Shock Traps and Thunder Ammo.',4,80,0,10),(54,'Baitbug','An insect used as fishing bait. A fish favorite, it practically races down the nearest gilly gullet.',3,2,0,10),(55,'Kelbi Horn','While not practical when forging equipment, Kelbi horns are a vital component of many items.',4,52,0,99),(56,'Dash Extract','A mysterious substance culled from certain monsters that increases endurance.',4,56,0,20),(57,'Nourishing Extract','Can be obtained from certain large monsters. Has the ability to amplify the effects of certain medicines.',4,122,0,20),(58,'Screamer Sac','A monster organ that emits an earsplitting sonic blast when ruptured. Used to craft screamer pods.',2,15,0,10),(59,'Catalyst','Works with other materials to enhance their effects. Cannot be used by itself.',2,48,0,5),(60,'Tranq Bomb','A hand grenade used to capture monsters ensnared in traps. Can be slammed against the ground.',3,35,0,8),(61,'Flash Pod','Slinger ammo that flashes brightly on impact. Fire it right under a monster\'s nose to blind it.',2,57,0,3),(62,'Screamer Pod','Used as ammo for your slinger. Emits a harsh, high-frequency sound that can disrupt sensitive monsters.',2,45,0,3),(63,'Dung Pod','Slinger ammo that releases a strong odor on impact. Causes certain monsters to flee.',2,20,0,10),(64,'Smoke Bomb','Creates a large cloud of smoke wherever it lands.',2,44,0,3),(65,'Poison Smoke Bomb','Releases a toxic cloud of mist when used. Also popular as a household bug bomb.',2,60,0,5),(66,'Farcaster','Call for a wingdrake to transport you to the nearest camp. Can also be used during battles.',3,30,0,1),(67,'Raw Meat','Meat carved from a monster. Can be cooked, combined, or used to set a trap.',1,5,0,10),(68,'Poisoned Meat','Raw meat that poisons whatever eats it. Makes great bait for traps.',2,19,0,10),(69,'Tinged Meat','Raw meat that paralyzes whatever eats it. Makes great bait for traps.',2,30,0,10),(70,'Drugged Meat','Raw meat that puts whatever eats it to sleep. Makes great bait for traps.',2,32,0,10),(71,'Gunpowder','A dangerous substance that explodes when struct or heated.',2,45,0,20),(72,'Small Barrel','',0,0,0,0),(73,'Barrel Bomb','',0,0,0,0),(74,'Bounce Bomb','',0,0,0,0),(75,'Mega Bounce Bomb','',0,0,0,0),(76,'Large Barrel','A large, empty barrel. Combine with gunpowser to make it into a bomb.',2,21,0,5),(77,'Large Barrel Bomb','',0,0,0,0),(78,'Mega Barrel Bomb','An upgraded large barrel bomb. Effective against large monsters.',4,80,0,2),(79,'Spider Web','A very sticky web. Used to craft pitfall traps.',1,6,0,10),(80,'Net','A sturdy net that supports a certain amount of weight without breaking. Perfect for pitfall traps.',2,54,0,10),(81,'Trap Tool','A must-have item for putting together pitfall traps and other kinds of traps.',3,20,0,2),(82,'Pitfall Trap','A trap for catching certain large monsters. It is tripped by a heavy weight.',3,200,0,1),(83,'Shock Trap','A trap that immobilizes a target. Use it to capture monsters.',3,160,0,1),(84,'Rolled-up Dung','A ball of condensed monster dung. Used to make dung pods for your slinger.',1,10,0,20),(85,'Dung','Exudes a prodigious smell. Used to make ammo for your slinger called dung pods.',1,1,0,10),(86,'Arowana Bait','A ball of bait favored by fish of the Arowana family.',2,15,0,10),(87,'Gunpowderfish Bait','A ball of bait favored by fish of the Gunpowderfish family.',2,15,0,10),(88,'Goldenfish Bait','A ball of bait favored by fish of the Goldenfish family.',2,30,0,10),(89,'Boomerang','An unusually-shaped weapon from abroad that returns to its user when thrown.',4,15,0,5),(90,'Binoculars','Allows you to see farther and observe from a distance.',1,5,0,1),(91,'Powercharm','An amulet that strengthens attacks. Just carrying this gives you demonic strength.',5,3,0,1),(92,'Powertalon','A charm that strengthens attacks. Its effects are amplified by the dragon parts it contains.',5,6,0,1),(93,'Armorcharm','An amulet that increases defense. Just carrying this hardens your skin like stone.',5,2,0,1),(94,'Armortalon','A charm that increases defense. Its effects are amplified by the dragon parts it contains.',5,5,0,1),(95,'Needleberry','A nut covered in needle-like spines. Used to make spread ammo.',1,1,0,99),(96,'Blastnut','A nut used to make sticky ammo.',1,4,0,30),(97,'Dragonstrike nut','A nut that explodes on impact. Used to make wyvern ammo.',2,12,0,5),(98,'Slashberry','Used to make slicing ammo.',1,4,0,60),(99,'Latchberry','A nut that bears a spiral groove. Used to make pierce ammo.',1,4,0,99),(100,'Bomberry','A nut that ruptures on impact. Used to make cluster bombs.',2,12,0,10),(101,'Flamenut','Used to make gunpowder that increases ammo firepower.',2,12,0,80),(102,'Blazenut','Used to make gunpowder that greatly increases ammo firepower.',2,12,0,60),(103,'Gunpowder Level 2','Combustible powser. Combine with level 1 ammo to raise its level.',2,1,0,80),(104,'Gunpowser Level 3','Highly combustible powser. Combine with level 1 ammo to raise its level.',2,3,0,80),(105,'Whetfish Fin','A fish fin used to sharpen weapons. Restores sharpness greatly, but good for fewer uses than a whetstone.',2,45,0,10),(106,'Whetfish Fin+','A fish fin used to sharpen weapons. Works better than a whetstone, and can be reused if you\'re lucky.',4,45,0,5),(107,'Sushifish Scale','A scale from a Sushifish. Eat to restore a small amount of health. Also works to treat bleeding.',2,45,0,10),(108,'Great S