ffinity.',7),(40,'Critical Boost','critical-boost','Increases the damage of critical hits.',3),(41,'Weakness Exploit','weakness-exploit','Increases the affinity of attacks that exploit a monster weak spot.',3),(42,'Focus','focus','Increases the fill rate for weapons with gauges and the charge rate for weapons with charge attacks.',3),(43,'Power Prolonger','power-prolonger','Allows long swords, dual blades, insect glaives, switch axes, and charge blades to stay powered up longer.',3),(44,'Handicraft','handicraft','Extends the weapon sharpness gauage. However, it will not increase the gauge past its maximum.',5),(45,'Critical Draw','critical-draw','Increases affinity when performing draw attacks.',3),(46,'Partbreaker','partbreaker','Makes it easier to break or sever parts of large monsters.',3),(47,'Slugger','slugger','Makes it easier to stun monsters.',3),(48,'Stamina Thief','stamina-thief','Increases certain attacks\' ability to exhaust monsters.',3),(49,'Master Mounter','master-mounter','Makes it easier to mount monsters.',1),(50,'Airborne','airborne','Increases the damage caused by jumping attacks.',1),(51,'Latent Power','latent-power','Temporarily increases affinity and reduces stamina depletion when certain conditions are met.',5),(52,'Agitator','agitator','Increases attack power and affinity when large monsters become enraged.',5),(53,'Peak Performance','peak-performance','Increases attack when your health is full.',3),(54,'Heroics','heroics','Increases attack power and defense when health drops to 35% or lower.',5),(55,'Fortify','fortify','Increases your attack and defense every time you fall in battle. (This effect can stack twice.)',1),(56,'Resentment','resentment','Increases attack when you have recoverable damage (the red portion of your health gauge).',5),(57,'Resuscitate','resuscitate','Improves evasion and reduces stamina depletion when afflicted with abnormal status effects.',1),(58,'Horn Maestro','horn-maestro','Increases the effect duration of huntin